import React from "react";
import './shop.css';

const Shop = () => {
    return (
        <div className="shops">
            <div className="shop-intro">
                <h2>Start Shopping Now</h2>
            </div>

            <div className="items">
                <img src="/combotsee2.jpg" alt="combo" />
                <img src="/combotsee1.jpg" alt="combo" />
                <img src="/goat2.jpg" alt="goat-tees" />
                <img src="/goat.jpg" alt="goat-tees" />
                <img src="/Airfoce.jpeg" alt="nike shoe" />
                <img src="/air2.jpeg" alt="nike shoe" />
                <img src="/oppp.jpg" alt="Op" />
                <img src="/sama.jpg" alt="samatha" />
                <img src="/sama2.jpg" alt="samatha" />
            </div>
        </div>
    );
}




export default Shop;
